import React, { Component } from "react";
import BookBar from "./BookBar";
import Slider from "./Slider";

class Home extends Component {
  render() {
    return (
      <div>
        <img
          className="logo"
          src="https://i.imgur.com/wKKjlcI.png"
          alt="A Novel Idea Logo"
        />
        <Slider />
        <BookBar />
      </div>
    );
  }
}

export default Home;
